import { useForm } from "react-hook-form";

export default function Buscador({onSubmit}){
    const {register, handleSubmit} = useForm();
    return <form className="fondo" onSubmit={handleSubmit(onSubmit)}>
        <input placeholder={"Buscar..."} className="b-input" {...register("name")} type="text" />
        
    </form>
    
}
